import '../styles/Inbox.css'

export default class Inbox extends React.Component{
    render(){
        return(
            <div id="inbox">
                <div className="xClose" onClick={() => { this.goBack(); this.props.onClick();}}>x</div>
            </div>
        )
    }
}
